// src/App.js (Updated with ProtectedRoute)
import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import "./App.css";
import "./fromLogin.css";

import FormLogin from "./components/FormLogin";
import Header from "./components/admin/inc/header";
import Dashboard from "./components/admin/dashboard";
import CreateUser from "./components/admin/user/createUser";
import IndexUser from "./components/admin/user/indexUser";
import { AuthProvider } from "./context/AuthContext";
import ProtectedRoute from "./components/ProtectedRoute";

function App() {
  return (
    <AuthProvider>
      <Router>
        <div className="App">
          <header className="Header">
            <Header />
          </header>

          <Routes>
            <Route path="/" element={<FormLogin />} />
            <Route
              path="/dashboard"
              element={<ProtectedRoute element={<Dashboard />} />}
            />
            <Route
              path="/createUser"
              element={<ProtectedRoute element={<CreateUser />} />}
            />
            <Route
              path="/indexUser"
              element={<ProtectedRoute element={<IndexUser />} />}
            />
          </Routes>
        </div>
      </Router>
    </AuthProvider>
  );
}

export default App;
